import React, {useEffect} from "react";
import Navbar from "./Header/Navbar/Navbar";
import Central from "./AboutUs/Central";

const AboutUs = () => {

    useEffect(() => {
        window.scrollTo(0, 0)
      }, [])

    return(
        <div>
            <Navbar></Navbar>
            <Central></Central>
        </div>
    )
}

export default AboutUs;
